description:
Dana DeArmond is new to the neighborhood and one of her only friends so far is Danny's wife. Dana decides to pay her a visit, but she's not home at the moment, Danny is though. He's just sitting around playing some foosball when Dana decides to let herself into his game room and join in on the fun. She doesn't really get the game though as she's used to playing with two balls. Well, Dana finds a better set of balls in Danny's pants and they put the foosball table to better use as the perfect piece of furniture to Censored on while Danny's wife is out.


